		$preco = $row['preco'];
		$img = $row['img'];
	}

	date_default_timezone_set('America/Sao_Paulo');

	$dia_l = date('D');
	$dia_n = date('d');
	$mes_l = date('M');

	$dia_chegada = $dia_n+15;

?>

